class Trip {
  constructor(
    name,
    location,
    difficulty,
    length,
    elevationChange,
    slug,
    imgURL
  ) {
    this.id = Trip.incrementId();
    this.name = name;
    this.location = location;
    this.difficulty = difficulty;
    this.length = length;
    this.elevationChange = elevationChange;
    this.slug = slug;
    this.imgURL = imgURL;
  }

  static incrementId() {
    if (!this.latestId) this.latestId = 1;
    else this.latestId++;
    return this.latestId;
  }
}

